func Benchmark_call(b *testing.B) {
	type Env struct {
		Fn func(string, string, string) bool
	}

	program, err := expr.Compile(`Fn("a", "b", "ab")`, expr.Env(Env{}))
	if err != nil {
		b.Fatal(err)
	}

	env := Env{
		Fn: func(s1, s2, s3 string) bool {
			return s1+s2 == s3
		},
	}

	for n := 0; n < b.N; n++ {
		_, err = vm.Run(program, env)
	}

	if err != nil {
		b.Fatal(err)
	}
}

